import './Preloader.scss';

import * as React from 'react';
import { Modal } from 'react-bootstrap';


export interface IPreloaderProps {
	style?: any;
	className?: string;
	inline?: boolean;
}

export class Preloader extends React.Component<IPreloaderProps, void> {

	constructor(props: any) {
		super(props);
	}

	public render(): JSX.Element {
		let ua: any = window.navigator.userAgent;
		let msIe: number = ua.indexOf('MSIE ');

		if (msIe > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./))
		{
			// tslint:disable
			// If Internet Explorer, return ugly preloader
			return (
				<div className={'ej-components__preloaderGif' + (this.props.className ? ' ' + this.props.className : '')}>
					<img src='data:image/gif;base64,' alt='preloader'/>
				</div>
			);
			// tslint:enable
		} else {
			return this.props.hasOwnProperty('inline')
				? <div className='ej-components__preloader' style={this.props.style ? this.props.style : null}/>
				: (
					<Modal dialogClassName='ej-components__preloaderModalDialog'
						   backdropStyle={{backgroundColor: "white"}}
						   show={true}
						   onHide={(): void => {
							   console.log('preloader hide');
						   }}
						   className='ej-components__preloaderModalWrap'
					>
						<div className='ej-components__preloader' style={this.props.style ? this.props.style : null}/>
					</Modal>
				);
		}
	}
}
